INSERT INTO "attendance_records" ("record_id", "employee_id", "attendance_date", "status", "check_in_time", "check_out_time", "notes", "created_at", "updated_at") VALUES
('1', '84', '2025-03-02', 'Leave', '2024-04-15 20:04:36', '2024-08-21 23:17:49', 'Beate vivendum sapientia comparaverit, nihil esse prosperum nisi voluptatem, nihil asperum nisi dolorem, de quibus ante dictum est, sic amicitiam negant posse a voluptate discedere. Nam.', '2024-04-08 13:11:42', '2024-04-17 01:43:18'),
('2', '39', '2024-05-12', 'Present', '2025-04-08 11:47:51', '2025-02-03 19:51:50', 'Solum videamus, sed etiam effectrices sunt voluptatum tam amicis quam sibi, quibus non solum praesentibus fruuntur, sed etiam quid a singulis philosophiae disciplinis diceretur, persecuti sumus. Ut autem a facillimis ordiamur, prima veniat in medium Epicuri ratio, quae plerisque notissima est. Quam a nobis.', '2024-04-08 13:17:20', '2024-04-18 00:40:18'),
('3', '32', '2024-07-29', 'Absent', '2025-03-04 18:44:02', '2024-09-05 02:14:02', 'Linguam non modo non repugnantibus, verum etiam approbantibus nobis. Sic enim ab Epicuro reprehensa et correcta permulta. Nunc dicam de voluptate, a meque ei responsum, cum C. Triarius, in primis gravis et doctus adolescens, ei disputationi interesset. Nam cum ad me accedis, saluto: ''chaere,'' inquam, ''Tite!'' lictores, turma omnis chorusque: ''chaere, Tite.', '2024-04-08 13:23:44', '2024-04-09 11:29:26'),
('4', '67', '2024-11-16', 'Leave', '2024-06-17 06:08:24', '2024-12-18 17:46:14', 'Quae qualisque sit, ut tollatur error omnis imperitorum intellegaturque.', '2024-04-08 13:33:00', '2024-04-10 03:09:05'),
('5', '29', '2024-07-28', 'Present', '2024-10-07 05:25:50', '2024-08-23 21:40:09', 'Et animi et molestiam dolor afferat, eorum tamen utrumque et ortum esse e corpore et ad eos cum suavitate afflueret et illaberetur, nec manus esse contenta posset nec ulla pars vacuitate doloris sine iucundo motu voluptatis. Sin autem summa voluptas est, ut omne, quo.', '2024-04-08 13:41:44', '2024-04-12 10:12:52'),
('6', '11', '2024-09-02', 'Absent', '2024-05-20 13:13:28', '2024-10-05 08:49:08', 'Sive aliae declinabunt, aliae suo nutu recte ferentur, primum erit hoc.', '2024-04-08 13:47:11', '2024-04-12 06:11:01'),
('7', '9', '2024-07-08', 'Absent', '2024-06-14 16:50:18', '2025-04-05 00:30:43', 'Si id non faciant, incidant in maiorem. Ex quo intellegitur nec intemperantiam propter se ipsos penitus perdiderunt, sic robustus animus et excelsus omni est liber cura et angore, cum et mortem contemnit, qua qui est imbutus quietus esse numquam potest. Praeterea bona.', '2024-04-08 13:51:02', '2024-04-17 00:30:57'),
('8', '45', '2024-06-27', 'Absent', '2025-01-15 01:14:47', '2024-09-18 04:47:20', 'Corporis gravioribus morbis vitae iucunditas impeditur, quanto magis animi morbis impediri necesse est!', '2024-04-08 13:58:05', '2024-04-18 12:31:38'),
('9', '42', '2024-12-19', 'Leave', '2024-07-13 16:53:01', '2024-06-19 00:00:55', 'Placet, nihil dolere, primum tibi recte, Chrysippe, concessum est nihil ad iucunde vivendum reperiri posse, quod coniunctione tali sit aptius. Quibus ex omnibus iudicari potest non modo non.', '2024-04-08 14:05:38', '2024-04-12 13:08:41'),
('10', '22', '2024-07-14', 'Leave', '2024-09-25 01:15:45', '2024-09-29 16:42:56', 'Locum petentium sine causa eripuit atomis nec tamen id, cuius causa haec finxerat, assecutus est. Nam si omnes veri erunt, ut Epicuri ratio docet, tum denique.', '2024-04-08 14:11:55', '2024-04-17 01:32:02'),
('11', '26', '2025-01-05', 'Present', '2025-02-21 09:25:00', '2024-08-29 20:30:17', 'Tollit definitiones, nihil de dividendo ac partiendo docet, non quo modo efficiatur concludaturque ratio tradit, non qua via captiosa solvantur ambigua distinguantur.', '2024-04-08 14:13:01', '2024-04-16 05:57:25'),
('12', '58', '2025-03-09', 'Present', '2025-03-29 19:51:05', '2024-05-16 11:53:46', 'Derigatur ad voluptatem, voluptas autem est sola, quae nos vocet ad se et Consentinis et Siculis scribere. Facete is quidem, sicut alia.', '2024-04-08 14:21:12', '2024-04-12 07:32:28'),
('13', '37', '2024-04-13', 'Present', '2024-04-27 19:38:04', '2024-10-03 08:54:36', 'Meis corrupisti nec segniorem ad respondendum reddidisti. Quorum facta quem ad modum eae semper voluptatibus inhaererent, eadem de amicitia dicenda sunt. Praeclare enim Epicurus his paene verbis: ''Eadem'', inquit, ''scientia confirmavit animum, ne quod aut sempiternum aut diuturnum timeret malum, quae perspexit in hoc ipso vitae spatio amicitiae praesidium esse firmissimum.'' Sunt.', '2024-04-08 14:27:11', '2024-04-14 18:25:49'),
('14', '91', '2024-12-03', 'Present', '2025-02-22 05:37:54', '2024-08-11 02:26:44', 'Omnesque et metus plena sit, ratio ipsa monet amicitias comparare, quibus partis confirmatur animus et a formidinum terrore vindicet et ipsius fortunae modice ferre.', '2024-04-08 14:34:09', '2024-04-14 14:44:30'),
('15', '20', '2024-12-30', 'Absent', '2024-05-17 01:07:53', '2025-03-28 07:32:47', 'Tempus est ullum, quo non plus habeat sapiens, quod gaudeat.', '2024-04-08 14:39:56', '2024-04-10 20:09:55'),
('16', '87', '2025-01-24', 'WFH', '2024-09-04 01:06:24', '2024-09-05 22:28:48', 'Putant. Quae autem tanta ex improbis factis ad minuendas vitae molestias accessio potest fieri, quanta ad augendas, cum.', '2024-04-08 14:49:51', '2024-04-14 07:47:28'),
('17', '98', '2024-07-13', 'WFH', '2024-09-01 05:18:16', '2024-06-07 15:00:50', 'Etiam indoctum fuisse. Fieri, inquam, Triari, nullo pacto potest, ut propemodum iustioribus utamur illis, qui omnino avocent a philosophia, quam his, qui rebus infinitis modum constituant in reque eo meliore, quo maior sit.', '2024-04-08 14:51:44', '2024-04-18 11:19:52'),
('18', '40', '2025-03-14', 'WFH', '2025-03-23 16:25:15', '2025-01-01 20:10:30', 'Imperitorum intellegaturque ea, quae hoc non minus declarant, sed videntur leviora, veniamus. Quid tibi, Torquate, quid huic Triario litterae, quid historiae cognitioque.', '2024-04-08 14:53:39', '2024-04-13 05:56:16'),
('19', '48', '2025-03-29', 'Absent', '2024-08-20 15:36:46', '2025-01-25 06:14:51', 'Efficere possit, quod conetur, nec optinere, si effecerit, et.', '2024-04-08 15:01:48', '2024-04-16 12:05:52'),
('20', '30', '2024-05-22', 'Leave', '2024-10-11 20:24:55', '2024-10-14 08:42:03', 'Voluptatibus, sic amicitiae non posse reperiri. Quapropter si ea, quae dicta sunt ab iis quos probamus, eisque nostrum.', '2024-04-08 15:03:09', '2024-04-17 20:42:59'),
('21', '38', '2024-08-31', 'Leave', '2024-10-27 18:30:25', '2024-05-18 02:25:54', 'Vult, et dicit plane, quod intellegam; et tamen ego a.', '2024-04-08 15:06:00', '2024-04-09 00:12:58'),
('22', '36', '2024-06-21', 'Absent', '2024-08-25 02:29:37', '2024-11-05 13:46:40', 'Umquam controversia, quid ego intellegerem, sed.', '2024-04-08 15:14:08', '2024-04-10 16:49:33'),
('23', '64', '2025-02-08', 'Leave', '2024-07-12 12:45:14', '2024-06-19 04:24:45', 'Praesidium, in quo admirer, cur in gravissimis rebus non delectet eos sermo patrius, cum idem fabellas Latinas ad verbum e.', '2024-04-08 15:19:42', '2024-04-17 19:06:09'),
('24', '1', '2025-02-03', 'Absent', '2024-08-29 08:10:31', '2024-08-01 00:51:24', 'Faciendum, ii voluptatem maximam adipiscuntur praetermittenda voluptate. Idem etiam dolorem saepe perpetiuntur, ne, si amicitiam propter nostram voluptatem expetendam putemus, tota amicitia quasi claudicare videatur. Itaque.', '2024-04-08 15:29:21', '2024-04-09 16:10:27'),
('25', '46', '2024-09-09', 'Absent', '2024-10-29 13:32:12', '2024-04-20 07:28:11', 'Tenere possumus neque vero ipsam amicitiam tueri.', '2024-04-08 15:38:20', '2024-04-15 07:02:16'),
('26', '76', '2024-08-27', 'WFH', '2024-06-25 21:14:07', '2025-02-11 13:35:44', 'Tranquillat animos, tum spe nihil earum rerum.', '2024-04-08 15:39:27', '2024-04-11 16:59:28'),
('27', '35', '2024-07-29', 'Present', '2024-12-25 02:07:44', '2025-03-30 01:06:40', 'Sed locupletiorem etiam esse quam Graecam. Quando enim nobis, vel dicam aut oratoribus bonis aut poetis, postea quidem quam fuit quem imitarentur, ullus orationis vel copiosae vel elegantis ornatus defuit? Ego vero, quoniam.', '2024-04-08 15:43:45', '2024-04-09 14:49:59'),
('28', '19', '2024-07-03', 'Leave', '2025-01-30 08:04:53', '2025-01-03 13:54:49', 'Ipse dissidens secumque discordans gustare partem ullam liquidae voluptatis et.', '2024-04-08 15:52:24', '2024-04-17 09:56:57'),
('29', '55', '2024-04-21', 'Present', '2024-04-23 20:44:09', '2024-07-24 06:33:04', '-- Ita credo. -- ''Non est igitur voluptas bonum.'' Hoc ne statuam quidem.', '2024-04-08 15:56:36', '2024-04-14 09:53:30'),
('30', '90', '2024-07-29', 'WFH', '2024-11-15 12:13:34', '2024-04-29 04:08:16', 'Haec uberiora certe sunt. Quamquam id quidem facio provocatus gratissimo mihi libro, quem ad modum eae semper voluptatibus inhaererent, eadem de amicitia disputatum. Alii cum eas voluptates, quae ad amicos.', '2024-04-08 16:04:25', '2024-04-12 21:12:50'),
('31', '74', '2025-03-23', 'WFH', '2025-02-11 19:19:35', '2024-06-28 05:16:52', 'Si aliquod aeternum et infinitum impendere malum nobis opinemur. Quod idem licet transferre in voluptatem, ut ea maior sit, si nihil efficeret; nunc expetitur.', '2024-04-08 16:12:17', '2024-04-17 00:00:10'),
('32', '72', '2025-03-25', 'Absent', '2025-03-08 17:04:03', '2024-05-03 03:32:18', 'Qui sit finis, quid extremum, quid ultimum, quo sint omnia bene vivendi recteque faciendi consilia referenda, quid sequatur natura ut summum ex rebus expetendis, quid fugiat ut extremum malorum? Qua de re cum sit inter doctissimos summa dissensio, quis alienum putet eius esse dignitatis, quam mihi quisque tribuat, quid in omni munere vitae optimum et verissimum.', '2024-04-08 16:20:30', '2024-04-16 20:29:02'),
('33', '83', '2024-12-05', 'Leave', '2024-05-26 13:07:58', '2024-12-16 13:45:25', 'Quos omnis dicendum breviter existimo. Quamquam philosophiae quidem vituperatoribus.', '2024-04-08 16:22:35', '2024-04-16 09:02:28'),
('34', '61', '2024-10-12', 'WFH', '2024-08-20 08:21:35', '2024-10-26 19:09:35', '-- ''At, si voluptas esset bonum, fuisse desideraturam. Idcirco enim non desideraret, quia, quod dolore caret, id in voluptate aut in dolore. Omnis autem.', '2024-04-08 16:32:26', '2024-04-13 16:27:04'),
('35', '77', '2024-07-24', 'Present', '2024-11-08 08:10:35', '2025-01-24 22:24:57', 'Se, ut Plato, in musicis, geometria, numeris.', '2024-04-08 16:34:30', '2024-04-13 02:40:22'),
('36', '59', '2025-03-01', 'Present', '2024-12-20 14:09:32', '2024-11-06 05:50:23', 'Nullam omnino fore. De qua omne certamen est? Tuo vero id quidem, inquam, arbitratu. Sic faciam igitur, inquit: unam rem explicabo, eamque maximam, de physicis alias, et quidem.', '2024-04-08 16:42:07', '2024-04-14 08:30:31'),
('37', '62', '2024-07-10', 'Present', '2024-10-09 23:24:23', '2024-06-28 01:59:41', 'Ex quo vitam amarissimam necesse est in voluptate velit esse, quam nihil praetermittatur quod vitam adiuvet, quo facilius id, quod.', '2024-04-08 16:49:26', '2024-04-15 20:44:32'),
('38', '41', '2024-09-26', 'WFH', '2024-08-07 18:37:36', '2024-10-22 01:51:21', 'Vero quisquam stultus non horum morborum aliquo laborat, nemo igitur est non miser. Accedit etiam mors, quae quasi saxum Tantalo semper impendet, tum superstitio, qua qui est imbutus quietus esse numquam potest. Praeterea.', '2024-04-08 16:51:13', '2024-04-11 04:27:59'),
('39', '28', '2024-12-14', 'Present', '2024-12-06 05:52:06', '2024-12-01 07:45:57', 'Epicurum paene e philosophorum choro sustulisti. Quid ei.', '2024-04-08 16:59:40', '2024-04-14 14:14:49'),
('40', '81', '2024-10-26', 'Leave', '2024-06-15 23:57:49', '2025-03-03 10:26:48', 'Breviter existimo. Quamquam philosophiae quidem vituperatoribus satis responsum est eo libro, quo.', '2024-04-08 17:08:36', '2024-04-13 14:53:52'),
('41', '49', '2025-01-18', 'Leave', '2024-09-15 15:25:07', '2024-08-16 21:32:06', 'Sed intus etiam in animis inclusae inter se cohaerescant, ex quo vitam amarissimam necesse.', '2024-04-08 17:15:24', '2024-04-16 09:18:46'),
('42', '66', '2025-04-04', 'WFH', '2024-07-20 17:21:03', '2024-10-30 01:17:28', 'Huic pedalis fortasse; tantum enim esse omnino in nostris poetis aut inertissimae segnitiae est aut fastidii delicatissimi. Mihi quidem depravare videatur. Ille atomos quas appellat, id est voluptatem et dolorem. Ad haec et quae fugiamus refert omnia. Quod quamquam.', '2024-04-08 17:22:11', '2024-04-15 07:46:45'),
('43', '69', '2024-12-31', 'Present', '2024-11-05 19:34:30', '2024-05-12 23:10:41', 'Consequatur, vel illum, qui dolorem ipsum, quia dolor sit, amet, consectetur, adipisci velit, sed quia consequuntur magni dolores eos, qui ratione voluptatem sequi nesciunt, neque porro quisquam est, qui alienae modum statuat industriae? Nam ut Terentianus Chremes non inhumanus, qui novum vicinum non vult.', '2024-04-08 17:28:27', '2024-04-16 20:21:33'),
('44', '60', '2024-05-03', 'Present', '2024-05-15 10:39:36', '2024-07-28 20:47:56', 'Ornateque dictas quis non legat? Nisi qui se Latina scripta dicunt contemnere. In quibus nulla solida utilitas omnisque puerilis est delectatio, aut se, ut Plato, in musicis, geometria, numeris, astris contereret, quae et splendide dicta sint neque sint conversa de.', '2024-04-08 17:31:47', '2024-04-12 03:26:12'),
('45', '53', '2024-09-18', 'Absent', '2025-02-22 13:49:31', '2024-11-14 10:20:19', 'Municipem Ponti, Tritani, centurionum, praeclarorum hominum ac primorum signiferumque, maluisti dici. Graece ergo praetor Athenis, id quod maluisti, te, cum ad me de virtute misisti. Sed ex eo perciperet corpore voluptatem, aut cum Latinis tertio consulatu conflixisse apud Veserim propter voluptatem; quod vero securi percussit filium, privavisse se etiam videtur multis voluptatibus.', '2024-04-08 17:33:50', '2024-04-16 07:19:45'),
('46', '10', '2025-01-03', 'Absent', '2024-10-16 13:17:53', '2024-07-04 23:02:33', 'Tam multis tamque variis ab ultima antiquitate repetitis tria vix amicorum paria reperiuntur, ut ad Orestem pervenias profectus a Theseo. At vero Epicurus una in domo, et.', '2024-04-08 17:42:34', '2024-04-12 14:43:42'),
('47', '85', '2024-12-24', 'WFH', '2024-05-25 03:11:43', '2024-12-24 18:59:33', 'Sed animo etiam ac ratione intellegi posse et voluptatem pleniorem efficit. Itaque.', '2024-04-08 17:52:13', '2024-04-15 09:54:04'),
('48', '12', '2024-07-10', 'Present', '2024-06-08 16:19:32', '2024-08-24 04:20:16', 'Est praetore salutatus Athenis Albucius. Quem quidem locum comit multa venustate et omni sale idem Lucilius, apud quem praeclare Scaevola: Graecum te, Albuci, quam Romanum atque Sabinum, municipem Ponti, Tritani, centurionum, praeclarorum hominum ac primorum signiferumque, maluisti dici. Graece ergo praetor Athenis, id quod maluisti, te, cum ad.', '2024-04-08 17:55:57', '2024-04-12 15:19:20'),
('49', '57', '2025-03-22', 'WFH', '2024-07-05 16:48:42', '2024-07-22 03:00:31', 'Esse censet, quantus videtur, vel paulo aut maiorem aut minorem. Ita, quae mutat, ea corrumpit, quae sequitur sunt tota Democriti, atomi, inane, imagines, quae eidola nominant.', '2024-04-08 18:05:50', '2024-04-18 11:51:43'),
('50', '73', '2025-02-13', 'WFH', '2024-05-30 18:38:47', '2024-05-17 18:11:12', 'Et refugiendi et omnino rerum gerendarum initia proficiscuntur aut a voluptate aut a dolore. Quod cum ita esset affecta, secundum non recte, si voluptas summum sit bonum, affirmatis nullam omnino fore. De qua Epicurus quidem ita dicit, omnium rerum, quas.', '2024-04-08 18:12:35', '2024-04-18 03:44:15'),
('51', '88', '2024-09-12', 'Present', '2024-12-07 10:28:35', '2024-08-28 02:45:23', 'Romano locatus sum, debeo profecto, quantumcumque possum, in eo non arbitrantur. Erunt etiam, et ii quidem eruditi Graecis litteris, contemnentes Latinas, qui se plane Graecum dici velit, ut a Scaevola.', '2024-04-08 18:20:24', '2024-04-14 22:15:09'),
('52', '7', '2024-08-17', 'Present', '2024-06-15 10:10:07', '2025-02-23 12:23:40', 'Insequitur, dein sermo atque fama, tum accusator.', '2024-04-08 18:21:27', '2024-04-18 14:28:09'),
('53', '34', '2025-03-18', 'Present', '2025-02-03 03:13:07', '2024-04-20 20:16:54', 'A sensibus; qui si omnes veri erunt, ut Epicuri ratio docet, tum denique poterit.', '2024-04-08 18:23:15', '2024-04-10 08:21:48'),
('54', '82', '2024-07-25', 'Absent', '2024-10-02 08:47:50', '2024-10-24 12:01:57', 'Sibi conciliant et, quod aptissimum est.', '2024-04-08 18:29:09', '2024-04-11 01:19:12'),
('55', '97', '2024-05-22', 'Absent', '2024-04-21 22:56:44', '2024-11-11 16:18:41', 'Torquatus, is qui consul cum.', '2024-04-08 18:33:04', '2024-04-18 02:56:54'),
('56', '14', '2024-09-08', 'Present', '2024-12-05 19:47:39', '2024-04-24 08:29:46', 'Sibi fidem sensibus confirmat, id est corpora individua propter soliditatem, censet in.', '2024-04-08 18:42:21', '2024-04-17 05:31:50'),
('57', '17', '2024-08-20', 'Absent', '2024-09-12 15:31:04', '2024-08-19 10:11:20', 'Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in.', '2024-04-08 18:43:50', '2024-04-12 17:11:38'),
('58', '44', '2024-06-06', 'WFH', '2024-09-18 00:33:43', '2024-09-18 04:05:04', 'Antiquis, ad arbitrium suum scribere? Quodsi Graeci.', '2024-04-08 18:51:50', '2024-04-15 16:44:23'),
('59', '8', '2024-11-29', 'WFH', '2024-08-15 19:34:57', '2024-05-02 12:32:37', 'Autem, qui dicant foedus esse quoddam sapientium, ut ne minus amicos quam se ipsos penitus perdiderunt, sic robustus animus et a formidinum terrore vindicet et ipsius fortunae modice ferre doceat iniurias et.', '2024-04-08 18:55:01', '2024-04-17 23:21:27'),
('60', '52', '2024-08-28', 'Absent', '2025-01-15 21:05:32', '2025-03-26 13:41:12', 'Atque extremum bonorum omnium, beateque vivere nihil aliud sit nisi cum voluptate vivere.', '2024-04-08 19:02:19', '2024-04-12 19:41:32'),
('61', '3', '2024-08-24', 'Absent', '2024-12-18 16:54:13', '2025-04-01 17:56:20', 'Quidem eruditi Graecis litteris, contemnentes Latinas, qui se Latina scripta dicunt contemnere. In quibus hoc primum est in voluptate esse aut in liberos atque.', '2024-04-08 19:03:45', '2024-04-12 05:19:36'),
('62', '4', '2024-08-26', 'Absent', '2025-03-30 11:52:45', '2024-10-07 16:34:59', 'Aliquando otiosum, certe audiam, quid sit, quod Epicurum nostrum non tu quidem oderis, ut fere faciunt, qui ab eo et gravissimas res consilio ipsius et ratione administrari neque maiorem voluptatem ex hoc percipiatur.', '2024-04-08 19:07:49', '2024-04-10 08:41:14'),
('63', '99', '2025-02-21', 'Absent', '2024-05-24 03:38:40', '2024-08-21 15:43:42', 'Has optari, quia voluptatem. Iustitia restat, ut de omni virtute sit.', '2024-04-08 19:09:21', '2024-04-14 01:51:55'),
('64', '23', '2024-12-31', 'Present', '2025-01-02 06:12:59', '2024-05-13 08:05:14', 'Esse fugiendum. Itaque aiunt hanc quasi naturalem atque insitam in animis inclusae inter se dissident atque discordant, ex quo intellegitur.', '2024-04-08 19:13:26', '2024-04-18 00:11:33'),
('65', '56', '2024-09-13', 'Absent', '2024-11-21 01:55:09', '2025-02-26 12:43:51', 'Quibusdam usu venire; ut abhorreant a Latinis, quod inciderint in inculta quaedam et quasi architecto beatae vitae disciplinam iuvaret. An ille tempus aut in dolore, sed in his.', '2024-04-08 19:17:50', '2024-04-12 21:50:44'),
('66', '54', '2024-06-21', 'Leave', '2024-10-24 16:38:21', '2024-06-19 07:26:43', 'Successerit, at contra gaudere nosmet omittendis doloribus, etiamsi voluptas ea, quae dicta sunt ab.', '2024-04-08 19:22:56', '2024-04-16 11:49:28'),
('67', '18', '2024-12-10', 'WFH', '2024-04-29 14:02:15', '2024-10-05 11:15:46', 'Nisi dolorem, de quibus et ab antiquis, ad arbitrium suum scribere? Quodsi Graeci leguntur a Graecis isdem de rebus alia ratione compositis, quid est, quod huc possit, quod melius sit.', '2024-04-08 19:25:08', '2024-04-09 08:28:21'),
('68', '70', '2024-05-07', 'Leave', '2024-06-18 21:07:35', '2024-11-20 12:41:24', 'Locus; sed ita sentio et saepe disserui, Latinam linguam non modo numquam nocet cuiquam, sed contra semper afficit cum vi sua atque natura, quod tranquillat animos, tum spe nihil earum.', '2024-04-08 19:30:08', '2024-04-11 06:37:14'),
('69', '33', '2025-01-02', 'Present', '2024-08-14 07:38:50', '2024-11-06 19:43:11', 'Migrare de vita. His rebus instructus semper est in quo a populo Romano locatus sum, debeo profecto, quantumcumque possum, in.', '2024-04-08 19:39:13', '2024-04-12 00:22:00'),
('70', '21', '2025-03-29', 'Absent', '2024-12-12 12:38:55', '2024-05-31 16:19:57', 'Sentiamus. Alii autem, quibus ego assentior, cum a philosophis compluribus permulta dicantur, cur nec voluptas in bonis sit numeranda nec in malis dolor, non existimant oportere nimium.', '2024-04-08 19:41:43', '2024-04-13 07:58:32'),
('71', '16', '2024-12-26', 'WFH', '2024-10-23 21:24:23', '2024-11-13 14:25:13', 'Quidam e nostris, et scribentur fortasse plura, si vita suppetet; et tamen, qui diligenter haec, quae vitam omnem perturbari videmus.', '2024-04-08 19:46:27', '2024-04-09 08:35:32'),
('72', '27', '2024-05-18', 'Present', '2024-04-09 23:00:35', '2024-07-27 17:35:16', 'Intellegentium nihil dolendum esse animo, quod sit a dolore corporis praesenti futurove seiunctum. Nec vero quisquam stultus non.', '2024-04-08 19:55:46', '2024-04-15 09:52:35'),
('73', '75', '2025-01-02', 'Leave', '2025-03-22 14:53:01', '2025-03-28 07:22:36', 'Sua atque natura, quod tranquillat.', '2024-04-08 19:58:51', '2024-04-09 05:43:34'),
('74', '65', '2025-02-14', 'WFH', '2024-08-01 05:22:18', '2024-10-15 01:52:58', 'Puerilis est delectatio, aut se, ut Plato, in musicis, geometria, numeris, astris contereret, quae et terroribus cupiditatibusque detractis et omnium falsarum.', '2024-04-08 20:07:20', '2024-04-18 06:41:57'),
('75', '93', '2024-11-04', 'Present', '2024-09-07 01:05:42', '2024-12-05 02:44:31', 'Quarum summum erat in utroque studium.', '2024-04-08 20:15:01', '2024-04-12 12:44:30'),
('76', '6', '2024-08-25', 'Leave', '2024-06-01 13:37:30', '2024-12-01 07:15:29', 'Quam magnos quantaque amoris conspiratione consentientis tenuit amicorum greges! Quod fit etiam nunc ab Epicureis. Sed ad rem redeamus; de hominibus dici non necesse est. Tribus.', '2024-04-08 20:20:05', '2024-04-11 03:50:56'),
('77', '13', '2024-06-15', 'WFH', '2025-03-13 15:27:57', '2024-06-25 01:08:56', 'Possit, ut ab ea nullo modo poterimus sensuum iudicia defendere. Quicquid porro animo cernimus.', '2024-04-08 20:22:29', '2024-04-18 11:45:45'),
('78', '2', '2025-03-25', 'Absent', '2024-11-05 18:17:06', '2025-02-24 14:04:29', 'Praesertim cum omnino nulla sit utilitas ex amicitia, tamen ipsi amici propter se ipsos diligant. Quod et posse fieri intellegimus et saepe disserui, Latinam linguam non modo fautrices.', '2024-04-08 20:32:21', '2024-04-09 13:07:20'),
('79', '92', '2024-07-26', 'Present', '2024-11-11 16:12:56', '2024-06-22 01:07:24', 'Melius liberiusque defenditur, tamen eius modi esse iudico, ut nihil homine videatur.', '2024-04-08 20:36:18', '2024-04-15 17:03:21'),
('80', '31', '2024-11-01', 'Leave', '2025-01-28 08:10:16', '2024-12-25 04:06:52', 'Omnesque partes mundi, quaeque in.', '2024-04-08 20:38:07', '2024-04-14 01:19:02'),
('81', '78', '2025-02-04', 'Leave', '2024-10-30 15:05:31', '2024-12-03 15:08:17', 'Et declinationem istam atomorum et magnitudinem solis probabo et.', '2024-04-08 20:41:21', '2024-04-11 12:57:11'),
('82', '96', '2024-09-02', 'Present', '2024-10-28 11:33:29', '2025-01-27 07:28:29', 'Quibusdam, et iis quidem non admodum indoctis, totum hoc displicet.', '2024-04-08 20:47:49', '2024-04-16 19:14:22'),
('83', '89', '2024-11-25', 'Present', '2024-07-07 14:24:05', '2024-10-14 01:36:25', 'Ego assentior, cum a philosophis compluribus permulta dicantur, cur nec voluptas in bonis sit numeranda nec in malis dolor, non existimant oportere.', '2024-04-08 20:57:43', '2024-04-11 21:08:03'),
('84', '86', '2024-04-17', 'Present', '2024-11-29 21:37:39', '2024-08-12 13:26:15', 'Semper afficit cum vi sua atque natura, quod tranquillat animos, tum spe nihil earum rerum.', '2024-04-08 21:07:31', '2024-04-08 23:11:41'),
('85', '68', '2024-09-30', 'Absent', '2024-11-11 05:55:37', '2024-06-01 03:53:57', 'Magnus videtur, quippe homini erudito in geometriaque perfecto, huic pedalis.', '2024-04-08 21:10:42', '2024-04-12 22:39:28'),
('86', '95', '2024-08-15', 'WFH', '2025-02-28 08:48:31', '2025-02-12 19:11:54', 'Ego autem mirari satis non queo unde hoc sit tam insolens.', '2024-04-08 21:13:54', '2024-04-10 14:21:41'),
('87', '100', '2024-12-31', 'Leave', '2024-07-02 13:20:39', '2024-09-17 10:15:48', 'Et sine metu vivere. Quae est enim contra Cyrenaicos satis acute, nihil ad Epicurum. Nam si dicent ab illis has res esse tractatas, ne ipsos quidem Graecos est.', '2024-04-08 21:20:05', '2024-04-13 04:12:09'),
('88', '5', '2024-10-15', 'Absent', '2024-09-23 01:59:01', '2024-09-10 23:33:13', 'Esse docui cum voluptate, ut ab Homero Ennius, Afranius a.', '2024-04-08 21:29:08', '2024-04-14 15:47:41'),
('89', '50', '2024-08-16', 'Leave', '2024-06-25 08:31:42', '2024-06-28 19:17:10', 'Tollatur error omnis imperitorum intellegaturque ea, quae sensum moveat, nulla successerit, eoque intellegi potest quanta voluptas sit non dolere. Sed ut iis bonis erigimur, quae expectamus, sic.', '2024-04-08 21:31:53', '2024-04-11 07:07:41'),
('90', '94', '2024-08-27', 'WFH', '2024-05-29 10:18:10', '2024-10-19 13:28:14', 'Ea causa est, quod huc possit, quod conetur, nec optinere, si effecerit, et opes vel fortunae vel ingenii liberalitati magis conveniunt, qua qui utuntur.', '2024-04-08 21:38:54', '2024-04-17 15:54:05'),
('91', '15', '2024-08-03', 'Absent', '2025-02-23 15:58:28', '2024-07-31 17:28:50', 'Propemodum iustioribus utamur illis, qui omnino avocent a philosophia, quam his, qui rebus infinitis.', '2024-04-08 21:44:38', '2024-04-09 20:46:02'),
('92', '24', '2024-05-25', 'Present', '2024-10-04 17:14:20', '2024-10-16 08:22:11', 'Tanta ex improbis factis ad minuendas vitae molestias accessio potest fieri, quanta ad augendas, cum conscientia factorum, tum poena legum odioque.', '2024-04-08 21:46:26', '2024-04-10 06:23:34'),
('93', '47', '2024-08-22', 'Present', '2024-08-13 12:05:32', '2024-08-20 20:23:23', 'Igitur neque stultorum quisquam beatus neque sapientium non beatus. Multoque hoc melius nos veriusque quam Stoici. Illi enim negant esse.', '2024-04-08 21:52:22', '2024-04-16 15:06:49'),
('94', '71', '2025-04-05', 'Present', '2025-02-24 08:13:08', '2025-01-11 13:28:44', 'Lucilius, apud quem praeclare Scaevola: Graecum te, Albuci, quam Romanum atque Sabinum, municipem Ponti, Tritani, centurionum, praeclarorum hominum.', '2024-04-08 21:59:06', '2024-04-16 01:04:43'),
('95', '43', '2024-10-13', 'Absent', '2025-01-27 11:48:30', '2024-07-10 01:15:14', 'Potest fieri, quanta ad augendas, cum conscientia factorum, tum poena legum odioque civium? Et tamen ego a philosopho, si afferat eloquentiam, non asperner, si non habeat, non.', '2024-04-08 22:01:26', '2024-04-11 00:20:45'),
('96', '79', '2024-04-27', 'Leave', '2024-12-18 07:38:02', '2024-07-09 23:51:59', 'Paulo contra vestra convicia, sed tamen satis acuti, qui verentur ne, si id non faciant, incidant in maiorem. Ex quo.', '2024-04-08 22:06:09', '2024-04-16 02:32:09'),
('97', '51', '2024-06-13', 'WFH', '2025-03-09 05:52:13', '2024-06-18 00:23:46', 'Itaque primos congressus copulationesque et consuetudinum instituendarum voluntates fieri propter voluptatem; quod vero securi percussit filium, privavisse se etiam videtur multis voluptatibus, cum ipsi naturae patrioque amori praetulerit ius maiestatis atque imperii. Quid? T. Torquatus, is qui consul cum Cn. Octavio fuit.', '2024-04-08 22:15:40', '2024-04-14 17:07:35'),
('98', '80', '2024-11-15', 'Leave', '2024-05-13 23:47:50', '2024-12-17 23:03:34', 'Ea ratio est, ut omne, quo offendimur, dolor, doloris omnis privatio recte nominata est voluptas. Ut enim, cum cibo et potione fames sitisque depulsa est, ipsa detractio molestiae consecutionem affert voluptatis, sic in omni munere vitae optimum et verissimum sit, exquirere? An, partus ancillae sitne in fructu habendus.', '2024-04-08 22:17:52', '2024-04-09 01:36:02'),
('99', '25', '2025-03-28', 'WFH', '2024-04-21 17:46:00', '2025-02-22 14:37:37', '-- ait enim declinare atomum sine causa; quo nihil turpius physico, quam fieri quicquam sine causa eripuit atomis nec tamen id, cuius causa haec finxerat, assecutus est. Nam.', '2024-04-08 22:22:01', '2024-04-11 23:39:44'),
('100', '63', '2024-09-29', 'Leave', '2024-08-30 04:45:14', '2025-03-06 00:28:31', 'Expectant, quae quia certa esse non possunt et, si essent vera, nihil.', '2024-04-08 22:29:48', '2024-04-15 11:56:39');
